import styled from "styled-components";

const LikesStyle = {
    ContainerLikes: styled.div`
    display: flex;
    align-items: center;
    padding-left: 100px;
    `,
    ContainerLikesUser: styled.div`
    max-width: 290px;
    max-height: 515px;
    border: solid 1px grey;
    border-radius: 15px;
    overflow: hidden;
    margin-right: 25px;
    :last-of-type {
        margin-right: 0;
    }
    `,
    ContainerBtnsLikes: styled.div`
    :first-child {
        margin-right: 25px;
    }`,
    Btn: styled.button`
    width: 70px;
    height: 70px;
    margin: auto;
    padding: 10px;
    border-radius: 45px;
    background-color: #80808000;
    `,
    TittleLikes: styled.h2`
    padding-top: 10px;
    padding-left: 100px;
    text-align: center;
    `
}

export default LikesStyle
